import React, { Fragment } from "react";
import { Card, Icon, Avatar } from "antd";

const { Meta } = Card;

const ReservationList = ({ data, date }) => {
  return (
    <Fragment>
      {data.map(card => (
        <Card key={card.id}></Card>
      ))}
    </Fragment>
  );
};

export default ReservationList;
